double round_5(double num)
{
	if((int)(num * 1000) % 10 == 5)
		num += 0.001;
	return num;
}

int main(int argc, char *argv[])
{
	int i, a, b, count;
	while(scanf("%d%d", &a, &b) != EOF)
	{
		for(count = 0, i = a; i <= b; i++)
			count += euler[i];
		printf("%.2lf\n", round_5(100.0 * count / (b - a + 1)));
	}
	return 0;
}

